import './App.css';
import Card from './components/card/card'
import CardContainer from './components/cardContainer/cardContainer';


function App() {
  return (
    <div>
      <div>
        <CardContainer cards={
          [1,2,3,4,5,6,7,8].map( (number) => {
            return <Card number={number}/>
          })
        }/>
      </div>
      <button onClick={move}>Default</button>;

    </div>
  );
}

export default App;
